1. Son una fuente de proteína vegetal. Su contenido de proteína es alto: 30 gramos contienen alrededor de 7 gramos de proteína.

2. Contienen arginina. La arginina es un aminoácido que es conocido como el precursor del óxido nítrico, que es un potente vasodilatador que ayuda a relajar las paredes de las arterias e inhibe la acumulación de plaquetas, lo que evita complicaciones cardiovasculares.

3. No tiene colesterol. Ningún producto vegetal lo contiene, e incluso ayudan a reducir el colesterol que ya se tiene en la sangre.

4. Su grasa es, en su mayoría, monoinsaturada y poliinsaturada. El 80% de la grasa contenida en el maní es grasa insaturada. Las grasas insaturadas se consideran más sanas, pues ayudan a disminuir el colesterol ”malo” y mantienen alto el ”bueno”. Además ayudan a disminuir los triglicéridos mejor que las dietas bajas en grasa.

5. Buena fuente de ácido fólico. Cuando las mujeres embarazadas lo consumen evitan que haya efectos en la formación del sistema nervioso del bebé. Además, ayuda a prevenir cáncer y enfermedades cardiovasculares.

