Para quienes siguen este tipo de alimentación... y también para quienes no
.
Ideales para salir de los clásicos desayunos y meriendas... los podemos acompañar con una infusion, jugo de frutas, frutas en trozos, frutos secos, o lo que les guste🤤
.
✨5 pancakes✨
🌱1 Pera o Manzana o Banana
🌱1 pocillo de leche vegetal (use de Almendras)
🌱1 pocillo de salvado de avena
🌱3 cucharadas de harina (puede ser comun o integral)
🌱1 cucharadita de polvo de hornear o bicarbonato
🌱3 cucharadas de coco rallado
🌱esencia de vainilla
.
✨como los hacemos✨
.
🌱Pelar y rallar la fruta, agregar la leche y por último los ingredientes secos
🌱Mezclar bien todo. En una sarten armamos los pancakes
🌱Como topping use mantequilla de mani @entrenuts , arándanos y coco
.
👩🏼‍🍳Lleva solo 5 minutos hacerlos, casi lo mismo que abrir un paquete de galletitas🍪
🍐Prioricemos la comida real, dediquémosle el tiempo que merece a nuestra nutrición, logremos hábitos que nos duren para siempre🤍
.
Se puede reemplazar la fruta por una clara de huevo, y la leche vegetal por leche de vaca. No hay excusas cuando hay ganas🌱💪🏼
